const AUTH0_CLIENT_ID = "a66nYqxZ8ZBdLyAEC5PoWrhJrv4dIxiJ"
const AUTH0_AUTHORIZATION_URL = "https://devicesquid.eu.auth0.com/authorize"
const AUTH0_SCOPES = "openid profile email"
const AUTH0_CALLBACK_URL = "http://localhost:60104"
const AUTH0_AUDIENCE = "https://device-orchestrator/api"

// AuthorizeUser implements the PKCE OAuth2 flow.
func AuthorizeUser() {
	// initialize the code verifier
	//var CodeVerifier, _ = cv.CreateCodeVerifier()

	verifier := oauth2.GenerateVerifier()
	challenge := oauth2.S256ChallengeFromVerifier(verifier)

	//authCodeURL := oauthConfig.AuthCodeURL(state, oauth2.AccessTypeOffline, oauth2.S256ChallengeOption(verifier))

	// Create code_challenge with S256 method
	//codeChallenge := verifier.CodeChallengeS256()

	u, err := url.Parse(AUTH0_AUTHORIZATION_URL)
	if err != nil {
		log.Fatal(err)
	}
	q := u.Query()
	q.Set("client_id", AUTH0_CLIENT_ID)
	q.Set("code_challenge", challenge)
	q.Set("code_challenge_method", "S256")
	q.Set("response_type", "code")
	q.Set("redirect_uri", AUTH0_CALLBACK_URL)
	q.Set("scope", AUTH0_SCOPES)
	q.Set("state", verifier)
	q.Set("audience", AUTH0_AUDIENCE)
	q.Set("mode", "")
	q.Set("allowLogin", "true")
	q.Set("allowSignUp", "true")

	u.RawQuery = q.Encode()
	fmt.Println(u)

	// construct the authorization URL (with Auth0 as the authorization provider)
	authorizationURL := u.String()

	// start a web server to listen on a callback URL
	server := &http.Server{Addr: AUTH0_CALLBACK_URL}
	resultChannel := make(chan string)
	// define a handler that will get the authorization code, call the token endpoint, and close the HTTP server
	http.HandleFunc("/", func(w http.ResponseWriter, r *http.Request) {
		// get the authorization code
		code := r.URL.Query().Get("code")
		state := r.URL.Query().Get("state")
		errorMsg := r.URL.Query().Get("error")
		errorDescription := r.URL.Query().Get("error_description")

		if errorMsg != "" {
			w.Write(errorResponse(errorMsg, errorDescription))
			cleanup(server)
			return
		}
		if code == "" || state != verifier {
			w.Write(errorResponse("invalid_state", "State does not match verifier"))
			cleanup(server)
			return
		}
		authToken, idToken, _ := getAccessToken(code, verifier)
		user, _ := fetchUser(authToken, idToken)
		resultChannel <- user

		w.Write(successResponse())
		cleanup(server)
		return
		// trade the authorization code and the code verifier for an access token
	})

	// parse the redirect URL for the port number
	u, err = url.Parse(AUTH0_CALLBACK_URL)
	if err != nil {
		fmt.Printf("snap: bad redirect URL: %s\n", err)
		os.Exit(1)
	}

	// set up a listener on the redirect port
	port := fmt.Sprintf(":%s", u.Port())
	l, err := net.Listen("tcp", port)
	if err != nil {
		fmt.Printf("snap: can't listen to port %s: %s\n", port, err)
		os.Exit(1)
	}

	// open a browser window to the authorizationURL
	print(authorizationURL)
	if err != nil {
		fmt.Printf("snap: can't open browser to URL %s: %s\n", authorizationURL, err)
		os.Exit(1)
	}

	// start the blocking web server loop
	// this will exit when the handler gets fired and calls server.Close()
	go server.Serve(l)
	res := <-resultChannel
	fmt.Println(res)
}

func errorResponse(errorMessage string, errorDescription string) []byte {
	return []byte(fmt.Sprintf(`<html>
        <body>
          <div style="height:100%%;width:100%%;inset:0;position:absolute;display:grid;place-items:center;background-color:#EFF2F7;text-align:center;font-family:Inter;">
            <h3 style="font-weight:200;">Login failed, please try again!</h3>
            <p>
              <b>%s</b>: %s}
            </p>
          </div>
        </body>
        </html>`, errorMessage, errorDescription))
}

// getAccessToken trades the authorization code retrieved from the first OAuth2 leg for an access token
func getAccessToken(code string, verifier string) (string, string, error) {
	// set the url and form-encoded data for the POST to the access token endpoint
	authurl := "https://devicesquid.eu.auth0.com/oauth/token"
	u, err := url.Parse(authurl)
	if err != nil {
		log.Fatal(err)
	}
	q := u.Query()
	q.Set("grant_type", "authorization_code")
	q.Set("client_id", AUTH0_CLIENT_ID)
	q.Set("code", code)
	q.Set("redirect_uri", AUTH0_CALLBACK_URL)
	q.Set("code_verifier", verifier)
	u.RawQuery = q.Encode()

	values := url.Values{}
	values.Set("grant_type", "authorization_code")
	values.Set("client_id", AUTH0_CLIENT_ID)
	values.Set("code", code)
	values.Set("redirect_uri", AUTH0_CALLBACK_URL)
	values.Set("code_verifier", verifier)

	// create the request and execute it

	req, _ := http.NewRequest("POST", authurl, strings.NewReader(values.Encode()))

	req.Header.Add("content-type", "application/x-www-form-urlencoded")
	res, err := http.DefaultClient.Do(req)
	if err != nil {
		fmt.Printf("snap: HTTP error: %s", err)
		return "", "", err
	}

	// process the response
	defer res.Body.Close()
	var responseData map[string]interface{}
	body, _ := ioutil.ReadAll(res.Body)

	// unmarshal the json into a string map
	err = json.Unmarshal(body, &responseData)
	if err != nil {
		fmt.Printf("snap: JSON error: %s", err)
		return "", "", err
	}

	// retrieve the access token out of the map, and return to caller
	accessToken := responseData["access_token"].(string)
	idToken := responseData["id_token"].(string)
	return accessToken, idToken, nil
}

// cleanup closes the HTTP server
func cleanup(server *http.Server) {
	// we run this as a goroutine so that this function falls through and
	// the socket to the browser gets flushed/closed before the server goes away
	go server.Close()
}

type CustomClaims struct {
	Email string `json:"Email"`
	//Sub   string `json:"Sub"`
	Name string `json:"Name"`
	jwt.StandardClaims
}

func fetchUser(accessToken string, idToken string) (string, error) {
	token, err := jwt.ParseWithClaims(idToken, &CustomClaims{}, func(token *jwt.Token) (interface{}, error) {
		// Normally, you would provide the key used to sign the token here
		// For example, if using HMAC:
		// return []byte("your-256-bit-secret"), nil
		return nil, nil
	})
	print(token)
	c := token.Claims.(*CustomClaims)
	user := map[string]interface{}{
		"email": c.Email,
		"name":  c.Name,
		"sub":   c.Subject,
	}
	b, _ := json.Marshal(user)
	userDownloadUrl := "https://api.deviceboxhq.com/api/v1/auth/users/loggedin"
	req, _ := http.NewRequest("POST", userDownloadUrl, bytes.NewReader(b))
	req.Header.Set("Authorization", "Bearer "+accessToken)

	res, err := http.DefaultClient.Do(req)
	if err != nil {
		fmt.Printf("fetchUser: HTTP error: %s", err)
		return "", err
	}

	/*acc.Email = user["email"].(string)
	acc.Auth0Id = user["sub"].(string)
	acc.Name = user["name"].(string)
	*/
	b, _ = io.ReadAll(res.Body)
	body := string(b)
	defer res.Body.Close()
	return body, nil
}

